import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import PatientList from "./components/PatientList";
import AddPatientForm from "./components/AddPatientForm";
import EditPatientForm from "./components/EditPatientForm"; 
import MedicalRecordList from "./components/MedicalRecordList"; // Import Medical Record List
import CreateMedicalRecord from "./components/CreateMedicalRecord"; // Import Create Medical Record

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<PatientList />} />
                <Route path="/add-patient" element={<AddPatientForm />} />
                <Route path="/edit-patient/:id" element={<EditPatientForm />} />
                <Route path="/patients/:patientId/create-record" element={<CreateMedicalRecord />} /> {/* Route for creating medical records */}
                <Route path="/medical-records" element={<MedicalRecordList />} /> {/* Route for listing medical records */}
            </Routes>
        </Router>
    );
};

export default App;
